import './App.css';
import Home from "./sections/Home"
import Projects from "./sections/Projects"
import Skills from "./sections/Skills"
import Experience from "./sections/Experience"
import Resume from "./sections/Resume"

function App() {
  return (
    <>
      <Home />
      <Projects />
      <Skills />
      <Experience />
      <Resume />
    </>
  );
}

export default App;
